g2:c.PROCEDURE.g2:a.TEXT:
start-test-app(test-code: text) = (float)
    process-status: float;
    process-exists: truth-value;
    cmd-line: text;
    log-file: text;
begin
    cmd-line = call get-file-path("rpc_test 2[test-code] [test-code] 30", true);
    log-file = call get-file-path("rpc[test-code].log", false);
    cmd-line = "[cmd-line] > [log-file]";
    process-status = call g2-spawn-process-to-run-command-line(cmd-line);
    if process-status = -1 then
    repeat
        wait for 1 second;
        process-exists = call g2-process-exists(process-status);
        exit if process-exists = false;
    end;
    return process-status;
end

get-file-path(filename: text, exe: truth-value) = (text)
    operating-system: symbol;
    dir-path: text;
begin
    operating-system = call g2-type-of-file-system();
    if operating-system = symbol("WIN32") then
    begin
        if exe then dir-path ="C:\G2\src\g2fasth\bin\Release\"
        else dir-path ="C:\G2\results\";
    end
    else
    begin
        if exe then dir-path ="/gensym/src/g2fasth/bin/"
        else dir-path ="/gensym/results/";
    end;
    return "[dir-path][filename]"; 
end

run-test(test-code: text) = (text)
    process-status: float;
    test-outcome: text;
    connects: integer;
begin
  // Start test application
    process-status = call start-test-app(test-code);
 
   // Establish GSI connection
    connects = 10;
    repeat
        change the text of the gsi-connection-configuration of rpc-interface to "tcp-ip host @"localhost@" port-number 2[test-code]";
        wait for 1 second;
        exit if the gsi-interface-status of rpc-interface = 2;
        connects = connects - 1;
        exit if connects = 0;
    end;
 
   // Check GSI connection
    if the gsi-interface-status of rpc-interface = 2 then
        // run remote test
        test-outcome = call rpc-test(test-code) across rpc-interface
    else
        test-outcome = "Could not connect GSI";

    // stop test application
    start rpc-exit() across rpc-interface;
    call g2-kill-process(process-status);
    wait for 2 second;

    return test-outcome;
end

rt-3227-2-test(node:class benchmark-test)
    process-status: float;
    test-outcome: text;
    connects: integer;
begin
  // Start test application
    process-status = call start-test-app("3227-2");
 
   // Establish GSI connection
    connects = 10;
    repeat
        change the text of the gsi-connection-configuration of rpc-interface to "tcp-ip host @"localhost@" port-number 23227";
        wait for 1 second;
        exit if the gsi-interface-status of rpc-interface = 2;
        connects = connects - 1;
        exit if connects = 0;
    end;
 
   // Check GSI connection
    if the gsi-interface-status of rpc-interface /= 2 then
    begin
        // stop test application
        start g2-kill-process(process-status);
        wait for 2 seconds;
        // return error
        call fail(node, "Could not connect GSI");
        return;
    end;
 
    // run remote test first time
    // FLOAT64-DAT is not declared there, so it should return "fail"
    test-outcome = call rpc-test("3227") across rpc-interface;
    if test-outcome = "pass" then
    begin
        call fail(node, "FASTH didn't raise an error about not declared variables");
        // stop test application
        start rpc-exit() across rpc-interface;
        call g2-kill-process(process-status);
        wait for 2 seconds;
        return;
    end;

    // Ask FASTH to declare FLOAT64-DAT variable
    call rpc-declare-variable("FLOAT64-DAT", "float") across rpc-interface;
 
    // run remote test second time
    // FLOAT64-DAT is declared there, so it should return "pass"
    test-outcome = call rpc-test("3227") across rpc-interface;
    if test-outcome = "fail" then
        call fail(node, "FASTH raised an error about not declared variables")
    else
        call pass(node);
 
    // stop test application
    start rpc-exit() across rpc-interface;
    call g2-kill-process(process-status);
    wait for 2 seconds;
 
end
